pragma solidity ^0.5.0;

library Digraph {

  struct Digraph {
    uint V;
    uint E;
    mapping (uint => uint[]) adj;
  }

  function createDigraph(Digraph storage self, uint _V) public
  {
    self.V = _V;
    self.E = 0;
    for (uint v = 0; v < self.V; v++)
      self.adj[v] = new uint[](0);
  }

  function getV(Digraph storage self) public view returns (uint) { return self.V; }
  function getE(Digraph storage self) public view returns (uint) { return self.E; }
  function getAdj(Digraph storage self, uint v) public view returns (uint[] memory)
  { return self.adj[v]; }

  function addEdge(Digraph storage self, uint v, uint w) public
  {
    self.adj[v].push(w);
    self.E++;
  }


